export default function Topbar()
{
    return( 
            <div class="header">
                <div className="nav"> <a href="#">Home </a></div> <div className="nav"> <a href="#">Service </a></div>  <div className="nav" > <a href="#">Login </a> </div> <div className="nav"><a href="#"> ContactUs </a></div>

            </div>
    )
}
